(526,'SPR-0526',39,287,9,604,1,'2015-08-13',4.00,750000,NULL,0,500000,21285000,3000000,0,123785000,102000000,126785000,105215000,0,'','','kpr',4,0,0,'2015-03-03','2015-04-19',NULL,NULL,'2015-08-24',NULL,'Realisasi',99000000,NULL,99000000,0,0,0,'0','0',0,0,0,0,NULL,'*HARGA KESEPAKATAN ADALAH HARGA RUMAH + TAMBAHAN TAMBAHAN - DISKON*\r\n1.	Harga rumah tersebut adalah Rp. 115.000.000,- (seratus lima belas juta rupiah).\r\n2.	Harga tambahan bangunan 3 m2 sebesar Rp. 6.000.000,-\r\n3.	Harga penambahan mutu bangunan (pagar setinggi 3,5 m dan plat cor) Rp 4.785.000,- (empat juta tujuh ratus delapan puluh lima ribu rupiah).\r\n4.	Promo Diskon sebesar Rp. 5.000.000,- (lima juta rupiah).\r\n5.	Kelebihan tanah sebesar 4 m2 dengan harga per meter Rp. 750.000,- (tujuh ratus lima puluh ribu rupiah) = Rp. 3.000.000,- (tiga juta tujuh ratus lima puluh ribu rupiah).','Realisasi KPR','BANK TABUNGAN NEGARA (BTN)','ACC','YUNITA DWI RATNASARI','2020-09-30 09:01:28','2020-10-05 14:15:20'),
